A normal metal (N) coupled to two superconducting electrodes (S) constitutes a Josephson junction, that is, a device capable of sustaining a dissipationless supercurrent \cite{Likharev,Superlattices-Courtois-1999,PRB-Angers08}. The small normal state resistance and lead-to-lead capacitance of SNS junctions make these strongly overdamped in the RCSJ model \cite{Likharev}, meaning that the quantum phase dynamics is intrinsically non-hysteretic. Still, hysteresis is observed in the voltage-current ($V$-$I$) characteristics of high-critical current SNS junctions due to electronic over-heating associated to the sudden onset of dissipation when the bias exceeds the critical current \cite{PRL-Courtois-2008}. Besides, under a microwave excitation at frequency $\nu$, the junction characteristics display current-independent voltage plateaus defined by $V_n=n h\nu/2e$ with $n$ an integer \cite{Shapiro}. These so-called Shapiro steps are due to the phase-locking of the supercurrent oscillations at the Josephson frequency $2eV/h$ to the microwave. Shapiro steps have been frequently used for studying the phase dynamics of a variety of Josephson junctions \cite{PRL-Dubos-2001,PRL-Lehnert-1999,PRL-LeSueur-2008,PRL-Chiodi-2009,PRL-Dassonneville-2013}, including junctions based on novel materials \cite{Science-Doh-2005,PRL-Cleuziou-2007,PRL-FuKane-2009,PRL-Jiang-2011,PRB-Dominguez-2012,CRP-Badiane-2013,PRL-Fuechsle-2009,PRB-Lombardi,NatPhys-Rokhinson,arxiv-Wiedenmann-2015,NatureNat-Pribiag}. 
Still, the interplay between the electron over-heating and the ac Josephson dynamics has not yet been investigated.

In this Letter, we discuss the response of high-critical current proximity Josephson junctions to a microwave excitation. We demonstrate the prominent role of electronic over-heating in the Shapiro steps map. Low-index steps can be masked by the switching to the resistive state. A simple model explains this behavior as well as the observation of a sharp discontinuity in the measured critical current when the ac current is increased.

We have fabricated Nb-Au-Nb junctions using a lift-off lithography technique based on an Al-Mo metallic bilayer as a shadow mask \cite{Nanotech-Samaddar-2013}, which avoids the deterioration of Nb superconducting properties by organic contamination. Conventional e-beam lithography, followed by a dry etch of the Mo top layer and a wet etch of the Al bottom layer, produces a locally suspended Mo mask. A shadow evaporation of Au (N island) and Nb (S leads) is performed through this mask at opposite angles. The edge roughness of the structures (see Fig. 1c inset) arises from the granularity of the Mo mask. The junctions were all about 210 nm wide, the separation between the Nb electrodes ranging from 180 to 500 nm, while the Au part was about 200 nm longer in order to ensure a good overlap with each electrode. The normal-state resistance of the junctions can be related to a diffusion constant $D$ in Au of about 100 cm$^2$/s. The critical temperature of the Nb electrodes is 8.5 K. Table 1 lists the main device parameters for the different junctions investigated.

Transport measurements were performed at temperatures down to 100 mK. Fig. \ref{DC}a-b show \emph{V-I} characteristics of a typical sample. At low temperature, a strong superconducting branch is observed (Fig. \ref{DC}a), with a large critical current $I_c$ exceeding 100 $\mu$A. This is achieved owing to the short length of the Au bridge and the high interface transparencies. Above $I_c$, the \emph{V-I} characteristic switches to the ohmic branch, characterized by the normal-state resistance $R_N$. When the current is lowered again, the $V$-$I$ characteristic remains on the ohmic branch down to the so-called retrapping current $I_r<I_c$. This pronounced hysteretic behaviour is of thermal origin and is typical of SNS junctions with a large critical current density \cite{PRL-Courtois-2008}. At higher temperatures however, the thermal instability at the switching is negligible and the characteristic recovers a reversible behavior (Fig. \ref{DC}b).

