Both the data (Fig. \ref{6GHz}a) and the calculations (Fig. \ref{6GHz}e) exhibit a sudden drop of the critical current $I_c$ as the retrapping current $I_r$ reaches the border of the $n=0$ Shapiro step (at a microwave current $I_{\mu}=I^*$ of about 0.04 in Fig. 2a). The numerical solution of the phase dynamics provides the explanation for this: for a zero dc current bias ($I=0$), while at an ac drive below $I^*$ the particle oscillates in a single washboard valley, above $I^*$ it hops back and forth between two valleys \cite{SuppMat}. Although not causing any dc voltage over the junction, this produces dissipation similar to that of the $n=1$ state, which is also revealed by the temperature map {\mbox Fig. \ref{Temp}a}.

