In summary, we have evidenced that electron over-heating is of paramount influence in the microwave response of Josephson junctions. Exploring the microwave response of Josephson junctions involves variable electronic temperatures, which is of uttermost importance for the complete analysis of devices based on new materials like topological conductors.

