\section{Numerical calculations}

Our model is an extension of the RSJ model with the temperature dependence of the critical current (Eq. (1) of the main text), the electronic temperature $T_e$ in N being governed by the thermal balance between the Joule power and the coupling to phonons. We here neglect other heat transport channels out of N, which will eventually lead to a somewhat lower temperature.

A sharp discontinuity in the differential conductance map at 6 GHz is described in the main text, see Fig. 2 of the main paper. Fig. \ref{Zoom} shows both a zoom of the map and the time-dependence of the phase at two points at the same dc current bias, but at an ac current signal amplitude just below and above the threshold. While the mean voltage is zero in every case, the phase's excursion is larger in amplitude at larger ac signal. It exceeds 2$\pi$ in the latter case, meaning that the effective particle travels over two neighboring minima of the potential landscape. The related dissipation makes the electronic temperature rise and the effective critical current drop, resulting in a sharp change in the differential conductance map.

