\section{Behavior at higher frequency}

In the higher frequency regime, we observe the appearance of fractional Shapiro steps at voltages $V_{n,m}=(n/m)\,h\nu/2e$, where $n$ and $m$ are integers. This appears as thin zero-differential resistance regions at intermediate positions compared to the integer steps in Fig. \ref{24GHz}a, and short steps in Fig. \ref{24GHz}b-d. Fractional Shapiro steps were already observed in similar devices \cite{PRL-Lehnert-1999,PRL-Dubos-2001,PRL-Fuechsle-2009}. Multiple Andreev Reflections as well as non-thermal out-of-equilibrium energy distribution function can contribute to this phenomena. As they are not included in our model, fractional steps are absent from the calculation results.

At higher frequency, the dissipation at a given amplitude $I_{\mu}$ is larger. The dominating effect of the microwave irradiation on the electronic population appears in Fig. \ref{24GHz} through the merging of the critical current and the retrapping current above an intermediate level of ac current bias $I_{\mu}>0.02$. As a consequence, no discontinuity is observed in the differential resistance map. Still, the n = 1 step is missing at low microwave excitation.

